import React, { Component } from 'react';
import { Link } from "react-router-dom";

export class Header extends Component {

    render() {
        return (
            <div id='m_menu' className='ui menu'>
                <Link to='/' className='item'>
                    <i className='icon home'></i> Home
                </Link>

                <Link to='/song_add' className='item'>
                    <i className='icon music'></i> Song Add
                </Link>

                <Link to='/song_list' className='item'>
                    <i className='icon list alternate'></i> Song List
                </Link>

                <Link to='/user_list' className='item'>
                    <i className='icon user'></i> User List
                </Link>

                {/* 48ms25ss */}
                <Link to='/logIn' className='item'>
                    <i className='user'></i>Login
                </Link>
            </div>
        )
    }
};

export default Header;
